import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  StyleSheet,
  Image
} from "react-native";

const Register = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <View style={styles.box}>
      <Text style={styles.text}>Register Page</Text>
      <Image style={styles.image} source={{uri: "https://i.ibb.co/Pm53kf8/584830f5cef1014c0b5e4aa1-1.png"}}/>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  box: {
    borderWidth: 2,
    borderRadius: 15,
    height: 300,
    width: 300,
  },
  text: {
    justifyContent: "center",
    fontSize: 30
  },
  image: {
    marginTop: 15,
    height: 200,
    widht: 300
  }
});

export default Register;
